import React from 'react';
import './KnowMorePage.css'; // Import CSS for styling if needed

const KnowMorePage = () => {
  return (
    <div>
      <nav
        style={{
          position: 'absolute',
          top: 10,
          left: 0,
          width: '100%',
          background: 'transparent',
          zIndex: 1,
          padding: '10px',
          display: 'flex',
          justifyContent: 'space-between',
          alignItems: 'center',
        }}
      >
        {/* Navbar content */}
      </nav>

      {/* NWA News and Reports Section */}
      <div
        style={{
          position: 'absolute',
          top: '80px', // Position it below the navbar
          left: '20px', // Align to the left
          color: 'black', // Text color
          fontWeight: 'bold', // Make it bold
          fontSize: '24px', // Set the font size
          zIndex: 10,
        }}
      >
        NWA News and Reports
      </div>

      {/* Rest of your Know More Page content */}
      <div
        style={{
          paddingTop: '120px', // To avoid overlap with the text above
          paddingLeft: '20px',
        }}
      >
        {/* Content related to Know More */}
        <p>Here you can add more detailed information about NWA news and reports...</p>
      </div>
    </div>
  );
};

export default KnowMorePage;
